<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <link rel="apple-touch-icon" href="apple-touch-icon.png">
  <meta name="theme-color" content="#1e2327">
  <script>
    if (!('theme-color' in document.createElement('meta'))) {
      var meta = document.createElement('meta');
      meta.name = 'theme-color';
      meta.content = '#1e2327';
      document.getElementsByTagName('head')[0].appendChild(meta);
    }
  </script>
  <script>
    if (!('theme-color' in document.createElement('meta'))) {
      document.querySelector('meta[name="theme-color"]').remove();
      var meta = document.createElement('meta');
      meta.name = 'theme-color';
      meta.content = '#1e2327';
      document.getElementsByTagName('head')[0].appendChild(meta);
    }
  </script>
  <link rel="manifest" href="/manifest.webmanifest" crossOrigin="use-credentials">
  <link rel="stylesheet" href="styles.css">
  <title>Document Title</title>
</head>

<body class="logged-in env-production page-responsive">
  <div data-turbo-body class="logged-in env-production page-responsive">
    <div data-turbo-body class="logged-in env-production page-responsive">
      <span data-view-component="true"></span>
      <svg width="16" height="16"></svg>
      <textarea name="feedback" class="form-control width-full mb-2" title="Feedback"
        placeholder="Enter your feedback here"></textarea>
      <label for="include_email">Include my email address so I can be</label>
      <div data-view-component="true"></div>
      <div class="d-flex flex-nowrap flex-justify-end mb-3 container-xl px-3 px-lg-5"></div>
      <div id="repository-details-container" class="flex-shrink-0" data-turbo-replace></div>
      <ul class="pagehead-actions flex-shrink-0 d-none d-md-inline"></ul>
      <ghcc-consent id="ghcc" class="position-fixed bottom-0 left-0"></ghcc-consent>
      <div class="Popover js-hovercard-content position-absolute"></div>
      <a target="_blank" rel="noopener"></a>
      <h4 class="SelectMenu-title f5" id="user-lists-menu-1">Lists</h4>
    </div>
  </div>
</body>

</html>
